[advanced]

public IneqMesh GetIneqMesh()
{
  	var ball = IneqLib.Ball(0, 0, 0, 1,4);
    var aball = IneqLib.Ball(0, 0, 0, 0.25,2, true);
	var cylinder1 = IneqLib.Cylinder(-0.6, 0, -1,-0.6, 0, 1, 0.2, 0.5);
  	var cylinder2 = IneqLib.Cylinder(0.6, 0, -1, 0.6, 0, 1, 0.2, 0.5);
	var acylinder1 = IneqLib.Cylinder(0, -0.6,-1, 0, -0.6, 1, 0.2, 0.5/*, true*/).Not();
  	var acylinder2 = IneqLib.Cylinder(0, 0.6, -1, 0, 0.6, 1, 0.2, 0.5/*, true*/).Not();
  
	var cylinder3 = IneqLib.Cylinder(-0.6, 0.6, -1,-0.6, 0.6, 1, 0.2, 0.5);
  	var cylinder4 = IneqLib.Cylinder(0.6, 0.6, -1, 0.6, 0.6, 1, 0.2, 0.5);

	var acylinder3 = IneqLib.Cylinder(-0.6, -0.6, -1,-0.6, -0.6, 1, 0.2, 0.5/*, true*/).Not();
  	var acylinder4 = IneqLib.Cylinder(0.6, -0.6, -1, 0.6, -0.6, 1, 0.2, 0.5/*, true*/).Not();
  
  
    return new IneqMesh
    {
        X0 = -1.0,
        Y0 = -1.0,
        Z0 = -1.0,
        X1 = 1.0,
        Y1 = 1.0,
        Z1 = 1.0,
        D = 0.1d,
        Boxed = false,
        IneqTree =
                (
                    (
                    	ball &
          				((x,y,z) => z) & 
          				aball
        			) 
          			| cylinder1
          			| cylinder2
          			| cylinder3
          			| cylinder4
        		) 
                & acylinder1 
                & acylinder2                
                & acylinder3 
                & acylinder4
	};
}
